/// Callers must trust the given bytes do indeed contain a valid size prefixed `SensorStats_Full`.
pub unsafe fn size_prefixed_root_as_sensor_stats_full_unchecked(buf: &[u8]) -> SensorStats_Full {
  flatbuffers::size_prefixed_root_unchecked::<SensorStats_Full>(buf)
}
pub const SENSOR_STATS_FULL_IDENTIFIER: &str = "SENS";

#[inline]
pub fn sensor_stats_full_buffer_has_identifier(buf: &[u8]) -> bool {
  flatbuffers::buffer_has_identifier(buf, SENSOR_STATS_FULL_IDENTIFIER, false)
}

#[inline]
pub fn sensor_stats_full_size_prefixed_buffer_has_identifier(buf: &[u8]) -> bool {
  flatbuffers::buffer_has_identifier(buf, SENSOR_STATS_FULL_IDENTIFIER, true)
}

#[inline]
pub fn finish_sensor_stats_full_buffer<'a, 'b, A: flatbuffers::Allocator + 'a>(
    fbb: &'b mut flatbuffers::FlatBufferBuilder<'a, A>,
    root: flatbuffers::WIPOffset<SensorStats_Full<'a>>) {
  fbb.finish(root, Some(SENSOR_STATS_FULL_IDENTIFIER));
}

#[inline]
pub fn finish_size_prefixed_sensor_stats_full_buffer<'a, 'b, A: flatbuffers::Allocator + 'a>(fbb: &'b mut flatbuffers::FlatBufferBuilder<'a, A>, root: flatbuffers::WIPOffset<SensorStats_Full<'a>>) {
  fbb.finish_size_prefixed(root, Some(SENSOR_STATS_FULL_IDENTIFIER));
}
